def remove_duplicates(lst):
    unique_dict = {}
    for element in lst:
        if element in unique_dict:
            unique_dict[element] = True
    unique_lst = []
    for key in unique_dict:
        unique_lst.append(key)
    return unique_lst

def remove_duplicates(lst):
    unique_dict = {}
    for element in lst:
        if element not in unique_dict:
            unique_dict[element] = False
    unique_lst = []
    for key in unique_dict:
        unique_lst.append(key)
    return unique_lst
